import sys
import os.path
from PIL import Image, ImageChops, ImageEnhance
import requests
import json
import traceback
import base64


def baseConversion(image_in):

    imgdata = base64.b64decode(image_in)
    filename = 'tmp/input.jpg'
    print(f"data is {imgdata}")
    with open(filename, 'w') as f:
        f.write(imgdata)

    im = Image.open(f'/tmp/input.jpg')
    im.show()
    print("completed")
    return filename


def lambda_handler(event, context):
    image_in = json.loads(event)['body']
    filename = baseConversion(image_in)
    return str(filename)
    try:
        resaved = filename + '.resaved.jpg'
        ela = filename + '.ela.png'
        im = Image.open(filename)

        im.save(resaved, 'JPEG', quality=95)
        resaved_im = Image.open(resaved)

        ela_im = ImageChops.difference(im, resaved_im)
        extrema = ela_im.getextrema()
        max_diff = max([ex[1] for ex in extrema])
        scale = 255.0/max_diff

        ela_im = ImageEnhance.Brightness(ela_im).enhance(scale)

        print(F"Maximum difference was {max_diff}")
        ela_im.save(ela)
        ela_im.show()
        print("done")
        return {
            "statusCode": 200,
            "body": "code ran wowo!!"
        }
    except Exception:
        return {
            "statusCode": 500,
            "body": json.dumps(traceback.format_exc())
        }


if __name__ == "__main__":
    input = ""

    event = str({"body": {"image_64": input}})
    context = None
    result = lambda_handler(event, context)
    print(result)
